import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    astronaut: {
        justifyContent: 'center',
        alignItems: 'center',
        position: 'relative',
        top: 34,
        maxHeight: 630,
        maxWidth: 630,
        [theme.breakpoints.down("md")]: {
            maxHeight: 1800,
            maxWidth: 1800,
            top: 0
        }
    },
}));

export default useStyles;
